import React from "react";

import Navbar from "../../components/navbar";

import Typography from "@material-ui/core/Typography";

class Work extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <Typography>Work</Typography>
      </div>
    );
  }
}

export default Work;
